import React, {Component} from 'react';
import Foodtit from "../productlistmsg/foodtit";
import './my.scss';
class My extends Component {
    render() {
        return (
            <div className="my">
                <Foodtit tit="我的"/>
            </div>
        );
    }
}

export default  My;
